var __lang = "zh-CN";
function GetLang(lang) {
    if (lang)
        __lang = lang;
    switch (lang) {
        case "en-US": return langEn;
        case "zh-TW": return langTw;
        case "ru-RU": return langRu;
        default: return langobj;
    }
}

function GetLangCaption(langId, caption) {
    var val = caption || langId;
    var langObj;
    switch (__lang) {
        case "en-US": langObj = langEn;
            break;
        case "zh-TW": langObj = langTw;
            break;
        case "ru-RU": langObj = langRu;
            break
        default: langObj = langobj;
            break;
    }
    if (langObj && langObj[langId])
        val = langObj[langId];
    return val;
}

